import React, { Component, Fragment } from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux';
//
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import BlockIcon from '@material-ui/icons/Block';
import EditIcon from '@material-ui/icons/Edit';

import Typography from '@material-ui/core/Typography';
import LDataGrid from '../../components/List/datagrid';
//
import { setDialog, setProducts } from '../../actions/productActions'
import { setCart } from '../../actions/cartAction'
import { setSnackbar } from '../../actions/appActions'
import { getApiContributors } from '../../providers/api'

import {InputCpf, stringCpf} from '../../providers/masks'
//const classes = useStyles();
class Contributors extends Component {
    state = {
        contributors: [],
    }
    /*async setPage(params = {page: 1} ){
        const contributors = await getApiContributors(params);
        this.setState({...this.state, contributors }) 
    } */
    async componentDidMount() {
        //  this.setPage();
    }

    render() {
        const authData = JSON.parse(localStorage.getItem("user"));
        const classes = {
            root: {
                maxWidth: 345,
                height: window.innerHeight -150
            },
            media: {
                height: 140,
            },
        }
        const rows = this.state.contributors.data ?? [];
        const columns = [
            { field: 'id', headerName: 'Id', width: 100 },
            { field: 'cpf', headerName: 'Nome', width: 150,
                valueFormatter: (params: ValueFormatterParams) => {
                    return stringCpf(params.value);
                }
            },
            { field: 'name', headerName: 'Nome', width: 650 },
            { field: 'function', headerName: 'Função', width: 200 },
            {
                field: 'active',
                headerName: 'Situação',
                width: 100,
                valueFormatter: (params: ValueFormatterParams) => {
                    return params.value === 1 ? "Ativo" : "Inativo"
                }
            },{
                field: 'acoes',
                headerName: 'Ações',
                width: 200,
                renderCell: (params: ValueFormatterParams) => (
                    <div>
                      <Button
                        variant="contained"
                        color="primary"
                        size="small"
                        style={{ marginLeft: 16 }}
                      >
                        <EditIcon fontSize="small" />
                      </Button>
                      <Button
                        variant="contained"
                        color="primary"
                        size="small"
                        style={{ marginLeft: 16 }}
                      >
                        <BlockIcon fontSize="small"/>
                      </Button>
                    </div>
                  ),
            },
        ];
        const flexBasis = '25%';
        const filter = [
            { column: 'cpf', label: 'Cpf', type: 'text', 
            mask: InputCpf, 
            flexBasis },
            { column: 'name', label: 'Nome', type: 'text', flexBasis },
            {
                column: 'function', label: 'Função', type: 'select',
                values: [
                    "Todos",
                    "Coordenador de usuários",
                    "Coordenador de parceiros",
                    "Gerente",
                    "Operador de marketing"
                ],
                value: "Todos",
                flexBasis
            },
            { column: 'active', label: 'Situação', type: 'select', values: ["Todos", "Ativo", "Inativo"], value: "Todos", flexBasis },
            //{ column: 'created_at', label: 'Data', type: 'date' },
        ]

        return (
            <Fragment>
                <AppBar position="static" styçe={{ padding: 10}}>
                    <Typography variant="h4">
                        Colaboradores
                    </Typography>
                </AppBar>
                <Card className={classes.root}>
                    <CardContent>
                        <LDataGrid rows={rows} columns={columns} filterInputs={filter} pageRequest={getApiContributors} />
                    </CardContent>
                    <CardActionArea>
                    </CardActionArea>
                    <CardActions>

                    </CardActions>
                </Card>
            </Fragment>
        )
    }
}
const mapStateToProps = store => ({
    session: store.authReducer.data,
    products: store.productReducer.products
});
const mapDispatchToProps = dispatch =>
    bindActionCreators({ setProducts, setSnackbar, setDialog, setCart }, dispatch);

export default connect(mapStateToProps, mapDispatchToProps)(Contributors)
